import React from "react";
import logo from "./logo.svg";
import "./App.css";
import Number from "./Number.js";
import Operation from "./Operation.js";
import Display from "./Display.js";

const App = () => {
  let arr = [
    "AC",
    "+/-",
    "%",
    "รท",
    "7",
    "8",
    "9",
    "x",
    "4",
    "5",
    "6",
    "-",
    "1",
    "2",
    "3",
    "+",
    "0",
    ".",
    "="
  ];
  return (
    <>
      <Display />
      {arr.map(value => (
        <Number key={value.index} value={value} number={value.index} />
      ))}
    </>
  );
};

export default App;
